        //             )
        //         })
        //     }
        // </ul>
        <></>
    )
}
const Content = () => {
    return (

        <div>content container</div>
    )
}

function BagDetails({ getProductById, productInfo }) {
    console.log('productInfo :>> ', productInfo);
    return (

        <><ContentContainer>
            {
                Object.keys(productInfo).map((product, index) => {
                    console.log('bagDetails :>> ', product)
                    return (
                        <div className="container">
                            <div className="row">
                                <div className="col-md-2">
                                    productInfo[product.product_name]
                                </div>
                                <div className="col-md-6"><Content /></div>
                            </div>
                        </div>
                    )
                })}
        </ContentContainer></>
    )

}
BagDetails.propTypes = {
    getProductbyID: PropTypes.func
}

const mapStateToProps = state => {
    return {
        productInfo: state.products.product
    }
}

export default connect(mapStateToProps, { getProductById })(BagDetails)
